PlayerStatistics = {}
PlayerStatistics.__index = PlayerStatistics

--- PlayerStatistics instance.
---@return PlayerStatistics
function PlayerStatistics:new()
    local instance = setmetatable({
        playerMetrics = {
            lastMatch = {},
            allMatchs = {}
        }
    }, PlayerStatistics)
    return instance
end

---Stops the thread that displays the player statistics.
function PlayerStatistics:stop()
    self.threadBuild = false
end

----Calculates the Kill/Death Ratio (KDR) for a player.
---@param kills number The total number of kills the player has.
---@param deaths number The total number of deaths the player has.
---@return number The player's KDR.
function PlayerStatistics:calculateKDR(kills, deaths)
    if not kills then
        kills = 0
    end
    if not deaths or deaths == 0 then
        return string.format('%.2f', tonumber(kills)) -- Alternatively, you could return a very high value or "infinity"
    end
    kills = tonumber(kills)
    deaths = tonumber(deaths)
    local kdr = tonumber(kills / deaths)
    return string.format('%.2f', kdr)
end

-- totalDamageReceived = number,
-- totalKills = number,
-- totalDamageDone = number,
-- totalDeaths = number,
-- bodyHitRate = <table, number>
-- totalHS number

---Sets the player metrics, including KDR and hit rates, converting all numbers to strings.
---@param playerMetrics table The table containing the players metrics.
function PlayerStatistics:setPlayerMetrics(playerMetrics)
    if type(playerMetrics) ~= 'table' then
        return
    end

    if not playerMetrics.lastMatch then
        playerMetrics.lastMatch = {}
    end

    local KDR = self:calculateKDR(playerMetrics.lastMatch.totalKills, playerMetrics.lastMatch.totalDeaths)
    playerMetrics.lastMatch.KDR = KDR
    for k, v in pairs(playerMetrics.lastMatch) do
        if type(v) == 'number' then
            playerMetrics.lastMatch[k] = tostring(v)
        end
    end

    if not playerMetrics.allMatchs then
        playerMetrics.allMatchs = {}
    end

    local KDR = self:calculateKDR(playerMetrics.allMatchs.totalKills, playerMetrics.allMatchs.totalDeaths)
    playerMetrics.allMatchs.KDR = KDR
    for k, v in pairs(playerMetrics.allMatchs) do
        if type(v) == 'number' then
            playerMetrics.allMatchs[k] = tostring(v)
        end
    end

    if playerMetrics.lastMatch.bodyHitRate then
        for k, v in pairs(playerMetrics.lastMatch.bodyHitRate) do
            playerMetrics.lastMatch.bodyHitRate[k] = tostring(v)
        end
    end

    if playerMetrics.allMatchs.bodyHitRate then
        for k, v in pairs(playerMetrics.allMatchs.bodyHitRate) do
            playerMetrics.allMatchs.bodyHitRate[k] = tostring(v)
        end
    end

    self.playerMetrics = playerMetrics
end

---Creates text on the screen.
---@param text string The text to display.
---@param x number The x coordinate for the text.
---@param y number The y coordinate for the text.
---@param scaleH number The height scale of the text.
---@param scaleW number The width scale of the text.
---@param r number The red color value of the text (0-255).
---@param g number The green color value of the text (0-255).
---@param b number The blue color value of the text (0-255).
---@param a number The alpha (transparency) value of the text (0-255).
---@param align number The alignment of the text.
---@param font number The font type of the text.
---@param minX number The minimum x coordinate for text wrapping.
---@param maxX number The maximum x coordinate for text wrapping.
---@param shadow boolean Whether or not the text should have a shadow.
function PlayerStatistics:CreateText(text, x, y, scaleH, scaleW, r, g, b, a, align, font, minX, maxX, shadow)
    SetTextFont(font)
    SetTextColour(r, g, b, a)
    SetTextScale(scaleH, scaleW)
    SetTextJustification(align)
    SetTextWrap(minX, maxX)
    SetTextEntry("STRING")
    AddTextComponentString(text)
    SetTextOutline()
    SetTextCentre(true)
    EndTextCommandDisplayText(x, y)
end

---Draws the player statistics on the screen, including KDR, kills, deaths, and hit rates.
---@param x number The x coordinate for the drawing.
---@param y number The y coordinate for the drawing.
---@param width number The width of the drawing area.
---@param height number The height of the drawing area.
---@param borderColor table A table containing the RGBA values for the border color.
---@param borderWidth number The width of the border.
---@param backgroundColor table A table containing the RGBA values for the background color.
function PlayerStatistics:drawPed(x, y, width, height, borderColor, borderWidth, backgroundColor)
    local fontMetric = 4

    local info = function(text, subtitle, x_, y_)
        self:CreateText(text, x_, y_, 1.2, 1.2, COLOR_TEXT_PED.r, COLOR_TEXT_PED.g, COLOR_TEXT_PED.b, COLOR_TEXT_PED.a,
            1, fontMetric, 0.0, 1.0, 0)
        DrawRect(x_, y_ + 0.068, 0.06, borderWidth, borderColor.r, borderColor.g, borderColor.b, borderColor.a)
        self:CreateText(subtitle, x_, y_ + 0.075, 0.4, 0.4, COLOR_TEXT_PED.r, COLOR_TEXT_PED.g, COLOR_TEXT_PED.b,
            COLOR_TEXT_PED.a, 1, 7, 0.0, 1.0, 0)
    end

    local Box = function(titleBox, relativeX, relativeY)
        local width_ = 0.15
        self:CreateText(titleBox, relativeX, relativeY - 0.23, 0.4, 0.4, COLOR_TEXT_PED.r, COLOR_TEXT_PED.g,
            COLOR_TEXT_PED.b, COLOR_TEXT_PED.a, 1, 7, 0.0, 1.0, 0)
        DrawRect(relativeX, relativeY, width_, height, backgroundColor.r, backgroundColor.g, backgroundColor.b,
            backgroundColor.a)
        DrawRect(relativeX, relativeY - height / 2 - borderWidth / 2, width_ + 2 * borderWidth, borderWidth,
            borderColor.r, borderColor.g, borderColor.b, borderColor.a)
    end

    local box1_relativeX = 0.3
    local box1_relativeY = y

    Box('Última Partida', box1_relativeX, box1_relativeY)

    local boxX = box1_relativeX + 0.065
    info(self.playerMetrics.lastMatch.KDR or '0', 'KDR', boxX - 0.10, box1_relativeY - 0.16)
    info(self.playerMetrics.lastMatch.totalHS or '0', 'HS', boxX - 0.032, box1_relativeY - 0.16)

    info(self.playerMetrics.lastMatch.totalKills or '0', 'KILLS', boxX - 0.10, box1_relativeY - 0.05)
    info(self.playerMetrics.lastMatch.totalDeaths or '0', 'DEATH', boxX - 0.032, box1_relativeY - 0.05)

    info(self.playerMetrics.lastMatch.totalDamageReceived or '0', 'DAMAGE\nRECEIVED', boxX - 0.10, box1_relativeY + 0.06)
    info(self.playerMetrics.lastMatch.totalDamageDone or '0', 'DAMAGE\nDONE', boxX - 0.032, box1_relativeY + 0.06)

    local box2_relativeX = 0.7
    local box2_relativeY = y
    Box('Relatório Geral', box2_relativeX, box2_relativeY)

    local boxX = box2_relativeX + 0.065
    info(self.playerMetrics.allMatchs.KDR or '0', 'KDR', boxX - 0.10, box2_relativeY - 0.16)
    info(self.playerMetrics.allMatchs.totalHS or '0', 'HS', boxX - 0.032, box2_relativeY - 0.16)

    info(self.playerMetrics.allMatchs.totalKills or '0', 'KILLS', boxX - 0.10, box2_relativeY - 0.05)
    info(self.playerMetrics.allMatchs.totalDeaths or '0', 'DEATH', boxX - 0.032, box2_relativeY - 0.05)

    info(self.playerMetrics.allMatchs.totalDamageReceived or '0', 'DAMAGE\nRECEIVED', boxX - 0.10, box2_relativeY + 0.06)
    info(self.playerMetrics.allMatchs.totalDamageDone or '0', 'DAMAGE\nDONE', boxX - 0.032, box2_relativeY + 0.06)

    local processHits = function(title, valuesTable, relativeX_, relativeY_)
        if not valuesTable then
            valuesTable = {}
        end

        self:CreateText(title, relativeX_, relativeY_ - 0.23, 0.4, 0.4, COLOR_TEXT_PED.r, COLOR_TEXT_PED.g,
            COLOR_TEXT_PED.b, COLOR_TEXT_PED.a, 1, 1, 0.0, 1.0, 0)

        DrawSprite('pedImage', 'pedImage1', relativeX_, relativeY_, IMAGE_PROPORTION_X, IMAGE_PROPORTION_Y, 0.0, 255,
            255, 255, 255)
        for k, v in pairs(POSITIONS_PED_BODY) do
            local relativePositionX = relativeX_ - v.position.x
            local relativePositionY = relativeY_ - v.position.y
            local value = '0'
            if valuesTable[v.index] then
                value = valuesTable[v.index]
            end
            self:CreateText(value, relativePositionX, relativePositionY, 0.4, 0.4, COLOR_TEXT_PED.r, COLOR_TEXT_PED.g,
                COLOR_TEXT_PED.b, COLOR_TEXT_PED.a, 1, 4, 0.0, 1.0, 0)
        end
    end

    processHits('PRECISÃO\nÚltima Partida', self.playerMetrics.lastMatch.bodyHitRate, x - 0.06, y)
    processHits('PRECISÃO\nRelatório Geral', self.playerMetrics.allMatchs.bodyHitRate, x + 0.06, y)

end

---Shows the player statistics, including KDR, kills, deaths, and hit rates.
---@param centerVerticallyAdjustment number An adjustment value for centering the display vertically.
function PlayerStatistics:Show(centerVerticallyAdjustment)

    local x, y = 0.5, 0.5
    local borderColor = {
        r = 255,
        g = 255,
        b = 255,
        a = 255
    }
    local borderWidth = 0.005
    local backgroundColor = {
        r = 255,
        g = 255,
        b = 255,
        a = 100
    }

    self:drawPed(x, y, IMAGE_PROPORTION_X, IMAGE_PROPORTION_Y, borderColor, borderWidth, backgroundColor)

end

---Builds and displays the player statistics in a separate thread.
function PlayerStatistics:build()
    if self.threadBuild then
        return
    end
    self.threadBuild = true
    Citizen.CreateThread(function()
        local txd = CreateRuntimeTxd('pedImage')
        local tex = CreateRuntimeTexture(txd, 'pedImage1', 256, 256)
        SetRuntimeTextureImage(tex, IMAGE)

        while self.threadBuild do
            self:Show()
            Citizen.Wait(0)
        end
    end)
end

IMAGE =
    [[data:image/png;base64,]]
